import com.eviware.soapui.impl.WorkspaceImpl;
import com.eviware.soapui.impl.wsdl.WsdlProject
import com.eviware.soapui.model.testsuite.*
import com.eviware.soapui.support.GroovyUtils
import com.eviware.soapui.SoapUI

/* LIBRARY INTIALIZATION BLOCK */

//def runner = SoapUI.getCmdLineRunner()
//def userName = runner != null ? runner.getUsername() : 'testuser'
//def pwUser = runner != null ? runner.getPassword() : '***********'
log.info('[INFO] ###### INITIALIZATION ######')
def rootPath=context.expand('${projectDir}')
def mainProject = testRunner.testCase.testSuite.project
log.info ('[INFO] rootPath: '+rootPath)
log.info ("[INFO] projectName: "+mainProject.getName())
def userName = context.expand('${#Project#username}')?: 'testUser'
def pwUser = context.expand('${#Project#password}')?: '9iQK8CGRYqianaRK8iVnTiRxv9XtLJ'
def env = context.expand('${#Project#env}')?: 'test'
def version = context.expand('${#Project#version}')?: '1.0'
def serviceId= mainProject.getName().startsWith('PSB-') ? 'psb' : 'fidus'
mainProject.setPropertyValue('userName', userName )
mainProject.setPropertyValue('password', pwUser )
mainProject.setPropertyValue('env', env )
mainProject.setPropertyValue('password', pwUser )
mainProject.setPropertyValue('version', version )
mainProject.setPropertyValue('serviceId', serviceId )

log.info('[INFO] ###### START PROCESSING COMMON SCRIPTS ######')
log.info('[INFO] initialization ScriptLibrary')
def projScriptLibraryName ='ScriptLibrary'
def project = null
def workspace = testRunner.testCase.testSuite.project.getWorkspace();
def rootPathFidus = serviceId =='fidus' ? rootPath : rootPath.replace('psb','fidus')
if(workspace != null){
  project = workspace.getProjectByName(projScriptLibraryName)
}
else{
  project = new WsdlProject(rootPathFidus+'/../'+projScriptLibraryName+'-soapui-project.xml');
}
if(!project.open) {
    project.reload()    
    if(workspace != null){
    	 project = workspace.getProjectByName(projScriptLibraryName)
    }
    else{
  	 project = new WsdlProject(rootPathFidus+'/../'+projScriptLibraryName+'-soapui-project.xml');
	}    
}

log.info('[INFO] processing common scripts')
//make a connection to the ScriptLibrary project
if(project.open && project.name == projScriptLibraryName ) {
  def lib = project.getTestSuiteByName("Library").getTestCaseByName("common")
  if(lib == null) {
    throw new RuntimeException("[ERROR] Could not locate ReusableScripts!!!!");
  }
  else{
  	 List<TestStep> testStepList = lib.getTestStepList() 
      testStepList.each() { 
      	testStep ->
      		log.info('[INFO] Run script >>>> '+ testStep.getName())      		      
      		testStep.run(testRunner, context)       		
      }
  }   
}
else{
  throw new RuntimeException("[ERROR] Could not find project 'ScriptLibrary' !!!!")
}
log.info('[INFO] ###### END PROCESSING ######')
